, which expand into large, irregular, ov',NULL,0,0),(26000,1020,'PlntStnd Computation','Calculate number of plant per area.',NULL,0,0),(26001,1020,'Mat DS87 date Estimation','Record date of physiological maturity (approx. DS87). It is estimated as when the grain reaches the maximum dry weight and the grain becomes viable. It is most easily determined in-field when 50% of the peduncles are ripe (i.e., yellow).',NULL,0,0),(26002,1020,'HelSpInc Estimation','Standard method for Helminthosporium species incidence.',NULL,0,0),(26003,1020,'HelSpLegacy Estimation','Standard method for Helminthosporium species legacy.',NULL,0,0),(26004,1020,'Rust Coefficient of infection Computation','Coefficient of infection (CI) calculated by multiplying the severity times a constant for host response: where immune = 0.0; R=0.2; MR =0.4; MS =0.8; and S=1.0.',NULL,0,0),(26005,1020,'Modified cobb scale for severity','Severity of leaf/stem/stripe rust is recorded as a percentage, according to the modified Cobb scale. As this relies upon observation it cannot be absolutely accurate. Thus it is common to use the following intervals: 0, 5, 10, 20, 40, 60, and 100 percent infection.',NULL,0,0),(26006,1020,'Rust severity scoring','Severity of leaf/stem/stripe rust is recorded as a percentage, according to the modified Cobb scale. As this relies upon observation it cannot be absolutely accurate. Thus it is common to use the following intervals: 0, 5, 10, 20, 40, 60, and 100 percent ',NULL,0,0),(26007,1020,'PrecoInc Estimation','Standard method for leaf rust incidence.',NULL,0,0),(26008,1020,'PrecoResp Estimation','Standard method for leaf rust response.',NULL,0,0),(26009,1020,'Rust coefficient of infection (CI)_calculation','Coefficient of infection (CI) calculated by multiplying the severity times a constant for host response: where immune = 0.0; R=0.2; MR =0.4; MS =0.8; and S=1.0.',NULL,0,0),(26010,1020,'PstriInc Estimation','Standard method for Stripe rust incidence.',NULL,0,0),(26011,1020,'Double digit Estimation','The method was improved by using two digits, representing the vertical disease progress and an estimate of severity. The first digit gives the relative height of the disease using the original 0-9 Saari-Prescott scale as a measure. The second digit shows the disease severity as a percentage but in terms of 0-9. Because it is difficult to evaluate diseases on dead leaves, disease notes should be taken when at least four leaves are still alive and green (soft to mid-dough growth stage). Then visually evaluate the average percentage severity on only those leaves of the uppermost four that are infected. In practice, the percent severity is estimated on an overall score. The following format is used for scoring severity: 10% coverage = 1, 20% coverage = 2, 30% coverage = 3, 40% coverage = 4, 50% coverage = 5, 60% coverage = 6, 70% coverage = 7, 80% coverage = 8, 90% coverage = 9. The score of 10 is not used.',NULL,0,0),(26013,1020,'StritInc Estimation','Standard method for Septoria tritici blotch incidence.',NULL,0,0),(26014,1020,'StritLegacy Estimation','Standard method for Septoria tritici blotch legacy.',NULL,0,0),(26015,1020,'StritResp Estimation','Standard method for Septoria tritici blotch response.',NULL,0,0),(26016,1020,'SnodoInc Estimation','Standard method for Septoria nodorum blotch incidence',NULL,0,0),(26017,1020,'HsatiLInc Estimation','Standard method for Spot blotch incidence.',NULL,0,0),(26018,1020,'HsatiLLegacy Estimation','Standard method for Spot blotch legacy.',NULL,0,0),(26019,1020,'TanSpotInc Estimation','Standard method for tan spot incidence in adult plants.',NULL,0,0),(26020,1020,'FnivLBInc Estimation','Standard method for Fusarium leaf blotch incidence.',NULL,0,0),(26021,1020,'EgramLegacy Estimation','Standard method for powdery mildew legacy.',NULL,0,0),(26022,1020,'FHBSpkResp Estimation','Standard method for FHB spike response.',NULL,0,0),(26023,1020,'FgramResp Estimation','Standard method for Fusarium graminearum response.',NULL,0,0),(26024,1020,'Hd DS55 date Estimation','Record date of heading (DS55) when 50% of the spike is emerged (i.e., middle of the spike at the flag leaf ligule) on 50% of all stems.',NULL,0,0),(26025,1020,'SepSpLegacy Estimation','Standard method for Septoria species legacy.',NULL,0,0),(26026,1020,'SepSpResp Estimation','Standard method for Septoria species response.',NULL,0,0),(26028,1020,'PhordInc Estimation','Standard method for Barley leaf rust incidence.',NULL,0,0),(26029,1020,'SnodoLegacy Estimation','Standard method for Septoria nodorum blotch legacy.',NULL,0,0),(26031,1020,'GW Measurement','Dry grains at 70oC and weigh. ',NULL,0,0),(26032,1020,'GW Measurement (200grains)','To measure two hundred grain weight (200GW), count out 200 entire grains (i.e., those possessing an embryo). Dry the grains at 70oC (48 hours should be sufficient) and weigh.',NULL,0,0),(26033,1020,'AcdTol  Estimation','Observe the growth of plants per plot/entry in a low pH (acid) soil field and rate the tolerance. ',NULL,0,0),(26034,1020,'Adult plants rust field response Estimation','Response (type of disease reaction) in adult plant to leaf/stem/stripe rust, refers to the infection type and is classified according to the following scale: 0-No visible infection. R-Resistant; necrotic areas with or without small pustules. MR-Moderately Resistant; small pustules surrounded by necrotic areas. M-Intermediate; pustules of variable size; some necrosis and/or chlorosis. MS-Moderately Susceptible; medium-sized pustules; no necrosis, but some chlorosis possible. S-Susceptible; large pustules, no necrosis or chlorosis.',NULL,0,0),(26035,1020,'TanSpotResp Estimation','Standard method for scoring tan spot response in adult plants.',NULL,0,0),(26036,1020,'AlTol Estimation','Observe the growth of plants per plot/entry in a soil presenting aluminum toxicity and rate the tolerance. ',NULL,0,0),(26037,1020,'ALVEOGRAPH determination AACC 54-30 A','1. A sample of 60 grams or 250 grams of flour is mixed with a salt solution to form a dough.  2. The dough is sheeted, rested and inflated in the Chopin Alveograph; 2. Five 4.5 centimeter circular dough patties are formed and then rested in the alveograph in a temperature-regulated compartment at 25 degrees Celsius for approximately 20 minutes; 3. Each dough patty is tested individually. The alveograph blows air into a dough patty, which expands into a bubble that eventually breaks; 4. The pressure inside the bubble is recorded as a curve on graph paper. The alveograph determines the gluten strength of a dough by measuring the force required to blow and break a bubble of dough. The results include P Value, L Value, and W Value.',NULL,0,0),(26038,1020,'Ant DS65 date Estimation','Record date of anthesis (DS65) when 50% of spikes have flowered (i.e. at least 1 anther dehisced).',NULL,0,0),(26039,1020,'AntDmg Estimation','Standard method for ant damage.',NULL,0,0),(26040,1020,'ArmyWDmg Estimation','Standard method for armyworm damage.',NULL,0,0),(26041,1020,'AtritResp Estimation','Standard method for alternaria leaf blight field response.',NULL,0,0),(26042,1020,'SGNDmg  Estimation','Distorted leaves and stems are evident prior to heading. As diseased plants approach maturity, galls are formed in the florets, replacing the kernels. The galls are similar in shape to the seed they replace and are dark brown in color. Large numbers of motile larvae are present within the galls and become active after the galls have been moistened. These nematodes can act as vectors of Clavibacter tritici.',NULL,0,0),(26043,1020,'AwnLng  Measurement','Standard method for awn length.',NULL,0,0),(26044,1020,'Boot DS45 date Estimation','Record booting stage (DS45) when 50% of culms present boot swollen. ',NULL,0,0),(26045,1020,'BTol Estimation','The response of a cultivar or genotype is expressed on a score 1-9, where 1= highly susceptible and 9 = highly tolerant, based on the extent of bronze colored necrosis of leaf tips extending down the leaf margins ',NULL,0,0),(26046,1020,'BSMV Estimation','Standard method for barley stripe mosaic virus incidence.',NULL,0,0),(26047,1020,'CID determination','Proceed following the protocol for sampling of grains or leaves for CID in Chapter 6 in Pask et al., 2012. Mass spectrometers generate differential values of stable carbon isotope composition (δ13C), expressed negative values in parts per thousand (‰) (Farquhar et al., 1989): δ13C (‰) = [(Rsample/Rstandard)–1] × 1000. Where: the ratio of heavy to light isotope (R = 13C/12C) for the sample is in comparison to Peedee Belemnite (PDB) carbonate (limestone) standard. Following Farquhar et al. (1989) – rather than using carbon isotope composition values (δ13C), positive values for CID (Δ13C) can be calculated for easier statistical analysis as: Δ13C = [(δa-δp)]/[1 + (δp/1000)]',NULL,0,0),(26048,1020,'CookSdF Measurement','Standard method for cookie spread factor.',NULL,0,0),(26049,1020,'ColeopLng  Measurement','Standard method for coleoptile length.',NULL,0,0),(26050,1020,'SawflyDmg Estimation','Standard method for sawfly damage.',NULL,0,0),(26051,1020,'CrmStr Estimation','Standard method for crumb structure. ',NULL,0,0),(26052,1020,'CropGrwRate Computation','Standard method for crop growth rate.',NULL,0,0),(26053,1020,'CT Measurement','Take measurements at least two times from full ground cover to the end of booting (\'pre-heading\'), and at least two times from the end of anthesis to late grainfilling (\'grain-filling\') -with 5-7 days between each measurement to give a reasonably heritable estimate of trait expression.',NULL,0,0),(26054,1020,'DnoxiDmg Estimation','Standard method for russian wheat aphid damage.',NULL,0,0),(26055,1020,'DR date Estimation','Record date of double ridge stage (DS14-15 approx.). Double ridge signifies that the plant’s main growing point will produce no more primordial leaves, and instead will produce primordial spikelets of the young spike. The dissection and observation of the main tiller apex on an optic magnifier is required.',NULL,0,0),(26056,1020,'DroughtTol Estimation','Observe the growth of plants per plot/entry under droughted condition and rate the tolerance. ',NULL,0,0),(26057,1020,'DR DT Computation','Number of days from sowing to double ridge (DS14-15 approx.). However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',NULL,0,0),(26058,1020,'DTE observation','Counted as days from sowing to the seedling emergence.',NULL,0,0),(26059,1020,'FND DS31 DT Computation','Number of days from sowing to first node detectable. However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',NULL,0,0),(26060,1020,'Boot DS39 DT Computation','Number of days from sowing to initiation of booting (DS39-DS41). However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',NULL,0,0),(26061,1020,'TSpl DT Computation','Number of days from sowing to terminal spikelet (DS25-30 approx.). However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',NULL,0,0),(26062,1020,'EMERD observation','It is an observation of the date when 50% of seedlings have emerged.',NULL,0,0),(26063,1020,'FHBDON Measurement','Standard method for content of deoxynivalenol or DON (vomitoxin) that is often associated with FHB (Fusarium spp.) infected grains.',NULL,0,0),(26064,1020,'FHBSplInc Computation','Calculated as the index (ratio) of infected spikelets over total number of spikelets by Calonectria nivalis (Fusarium nivale, F. graminearum) causing scab disease in spike.',NULL,0,0),(26065,1020,'Field response McNEAL Estimation','Response (type of