 approximately 1 cm above the tillering node. The observation is performed in the main tiller.',NULL,0,0),(26072,1020,'GFP days Computation','Calculated time between anthesis (DS65) and maturity (DS87)of crop cycle duration.',NULL,0,0),(26073,1020,'GlmCol Estimation','Standard method for glume color.',NULL,0,0),(26074,1020,'GlmGlau Estimation','Standard method for glume glaucousness.',NULL,0,0),(26075,1020,'GLMLNG measurement','Standard method for glume length.',NULL,0,0),(26076,1020,'GlmPubDen  Estimation','Standard method for glume pubescence density.',NULL,0,0),(26077,1020,'GlmPubLng Measurement','Standard method for glume pubescence length.',NULL,0,0),(26078,1020,'GLMWID measurement','Standard method for glume width.',NULL,0,0),(26079,1020,'FLRGluCon Measurement','1. A 10-gram sample of flour or ground wheat is weighed and placed into the glutomatic washing chamber on top of the polyester screen; 2. The sample is mixed and washed with a 2 percent salt solution for 5 minutes; 3. The wet gluten is removed from the washing chamber, placed in the centrifuge holder, and centrifuged; 4. The residue retained on top of the screen and through the screen is weighed.',NULL,0,0),(26080,1020,'GluTyp Estimation','Gluten type is determined based on gluten properties data (flour protein content, Alveograph W, Alveograph P/L) following Peña 2011: Wheat End-use Quality types.',NULL,0,0),(26081,1020,'GN Computation','Grain number (GNO) as other yield components can be calculated or measured individually (Bell and Fischer, 1994; Reynolds et al., 2001; Pask et al., 2012), decide which method suit better for your objectives. GNO determines the sink size of the crop and under many conditions it is strongly correlated with yield. Grains/m2 (GNO) = yield (g/m2) / TGW (g) × 1000.',NULL,0,0),(26082,1020,'GrndCov Measurement (GS15)','Standard method for ground cover at 5 leaves stage.',NULL,0,0),(26083,1020,'GrndCov Measurement',' High throughput approaches to measuring ground cover are: visual assessment or digital analysis of photographs',NULL,0,0),(26084,1020,'GIron Measurement','Standard method for grain iron content.',NULL,0,0),(26085,1020,'GPhos Measurement','Standard method for grain phosphorus content.',NULL,0,0),(26086,1020,'GReten Measurement','Measured as weight by percentage of all matter remaining above a 2 mm slotted screen – 40 shakes in the direction of the slots.',NULL,0,0),(26087,1020,'GScreen Measurement','Measured as weight by percentage of all matter passing through a 2 mm slotted screen – 40 shakes in the direction of the slots',NULL,0,0),(26088,1020,'GZinc Measurement','Standard method for grain zinc content.',NULL,0,0),(26089,1020,'GrwCls Estimation','Classification of vernalization responsive growth habit as winter, facultative or spring wheat',NULL,0,0),(26090,1020,'WtrLoggDmg  Estimation','Score the damage caused by waterlogging',NULL,0,0),(26091,1020,'HavenDmg Estimation','Cereal cyst nematodes are more readily detected on seedlings than on adult plants. The roots of infested plants develop frequent branches and swellings (cysts).',NULL,0,0),(26092,1020,'HeatTol Estimation','Observe the growth of plants per plot/entry under heat condition and rate the tolerance. ',NULL,0,0),(26093,1020,'HesFlyDmg Estimation','Standard method for hessian fly damage.',NULL,0,0),(26094,1020,'HNecro Estimation','Some forms of spotting and necrosis result from chromosomal instability or genetic aberrations; these disorders are known as hybrid necrosis. Affected plants show differing degrees of necrosis, often associated with stunting or dwarf clumping. Hybrid necrosis usually is observed in early generation material, and affected progeny are eliminated',NULL,0,0),(26095,1020,'GHrd Measurement','Standard method for grain hardness class.',NULL,0,0),(26096,1020,'Boot DS39 date Estimation','Record date of initiation of booting stage when 50% of the culms expected to produce spikes are between DS39 (Flag leaf ligule/collar just visible) and DS41 (Flag leaf sheath extending).',NULL,0,0),(26097,1020,'InfertTN Counting','Count the number of infertile tillers.',NULL,0,0),(26098,1020,'ISBM Measurement','Sampling is typically performed at sequential developmental stages/time intervals through crop growth. Cut all aboveground biomass in a predetermined area (A). Avoid border effects by sampling away from edges of plot.  In most cases, determinations of dry mass are made on representative sub-samples to reduce oven space requirement, take additional measurements (e.g., fertile culm count) etc. Several protocols available (Bell and Fischer, 1994; Reynolds et al., 2001; Pask et al., 2012), decide which method suit better for your objectives.',NULL,0,0),(26099,1020,'LAI Computation','LAI can be determined directly by taking a sample of canopy from a plant canopy, measuring the leaf area per sample plot with an area meter or image scanner and dividing it by the plot land surface area. Indirect methods use ceptometer to measure canopy geometry or light extinction and relate it to LAI. (LAI = leaf area / ground area, m2 / m2).',NULL,0,0),(26100,1020,'LEAFLNG measurement','Standard method for leaf length.',NULL,0,0),(26101,1020,'LeafPubDen Estimation','Standard method for leaf pubescence density.',NULL,0,0),(26102,1020,'LeafPubLng  Measurement','Standard method for leaf pubescence length.',NULL,0,0),(26103,1020,'LeafThk Measurement','Standard method for leaf thickness.',NULL,0,0),(26104,1020,'LeafTNecro Estimation','Leaf tip necrosis is observed and rated in percentage.',NULL,0,0),(26105,1020,'LEAFWID measurement','Standard method for leaf width.',NULL,0,0),(26106,1020,'Minolta Chroma Meter Test','Measurement of flour/whole meal/grain color with the Minolta chromameter, L value represents whiteness, a* value (reddishness) represents red and green colors and b* value (yellowness) represents yellow and blue colors. Using the Minolta Chroma Meter Test: 1. A sample of flour/whole meal/grain is placed on the granular materials at