tion it cannot be absolutely accurate. Thus it is common to use the following intervals: 0, 5, 10, 20, 40, 60, and 100 percent infection.',NULL,0,0),(26116,1020,'PhotopResp Estimation','Observe the tendency of flowering according day-length',NULL,0,0),(26117,1020,'PherpResp Estimation','Standard method for eye spot field response.',NULL,0,0),(26118,1020,'PLNTGRNYLD determination','The individual plant grain weight harvested is registered on a scale (Bell and Fischer, 1994; Reynolds et al., 2001; Pask et al., 2012) or calculated from grain yield and plant stand.',NULL,0,0),(26119,1020,'PnegleDmg Estimation','Above-ground symptoms of root lesion nematodes are often indistinct and difficult to identify, but include poor vigor, stunted growth, poor tillering, and wilting in response to moisture stress. Often, crop growth in an infected field will be irregular or patchy. Below ground, cereal roots will display generalized root browning, with lesions rapidly coalescing to produce extensive areas of discoloration. Lesions are only readily observed on the roots in the very early stages of infection. Lateral roots will be reduced in both length and number, and the root system may be thin and poorly branched or appear necrotic.',NULL,0,0),(26120,1020,'PthornDmg Estimation','Above-ground symptoms of root lesion nematodes are often indistinct and difficult to identify, but include poor vigor, stunted growth, poor tillering, and wilting in response to moisture stress. Often, crop growth in an infected field will be irregular or patchy. Below ground, cereal roots will display generalized root browning, with lesions rapidly coalescing to produce extensive areas of discoloration. Lesions are only readily observed on the roots in the very early stages of infection. Lateral roots will be reduced in both length and number, and the root system may be thin and poorly branched or appear necrotic.',NULL,0,0),(26121,1020,'RcereInc Estimation','Main shoots are assessed for sharp eyespot dis